import React from "react";
import "./Quotebox.js";
import "./App.css";

import { Button } from "./components/Button";

function App() {
  const clickHandler = () => {
    console.log("hi");
  };
  return (
    <div className="App">
      <header className="App-header">
        <div className="quote-box">
          <p className="quote">
            This is a hardcoded quote until i get the stying done.
          </p>
          <p className="author">me</p>
          <Button onClick={clickHandler}>Another Quote</Button>
        </div>
      </header>
    </div>
  );
}

export default App;
